Our Mission Statement:

The Michigan Scholastic Cycling Association works to establish and maintain safe, quality scholastic cycling programs. The Association is responsible for establishing a program that will:

    Provide students who have the desire to race bicycles with the coaching and camaraderie that will help them achieve both competitive and non-competitive cycling goals in a safe and enjoyable manner;
    Develop an awareness of what it is to be an amateur athlete that is both gracious and respectful to their community;
    Create an environment in which they may discover new friendships and find role models;
    Guide students towards learning new skills and disciplines, and spread the foundations of bike racing across the state;
    Foster a responsible attitude toward the use of trails and wilderness;
    Promote the value of cycling to our community as a mode of transportation and as a lifelong sport.

MiSCA is a part of the Michigan Mountain Biking Association. The Michigan Mountain Biking Association (MMBA) is a 501(c)(3) charitable non-profit corporation. 

The MMBA has over 2,500 members within nine chapters throughout Michigan and are one of the largest affiliates of the International Mountain Bicycling Association (IMBA.)
